import { ACTION_ADD_INPUT_LINE, ACTION_ADD_LINE } from "./actionTypes"

export const actionAddInputLine = (line) => {
    return {
        type: ACTION_ADD_INPUT_LINE,
        payload: line,
    }
}

export const actionAddLine = (line) => {
    return {
        type: ACTION_ADD_LINE,
        payload: line,
    }
}
